import vac from './vac.jpg';
import './Home.css';
const Home = () => {
    return ( 
        <div className="home">
            <div className="imagespace">
                <img className ="image" src={vac} />
            <h1> MedicumZone - Twoja przychodnia</h1>
            <p>Nie pozwól Covidowi pokrzyżować twoich planów</p>
            <p>Zaszczep się już dziś!</p>
            </div>
            <p></p>
        </div>
        
        
     );
}
 
export default Home;
